import { CircularProgressbar } from 'react-circular-progressbar'
import { MdCheckCircle, MdError, MdLink } from 'react-icons/md'

import { Container, FileInfo, Preview } from './styles'

function FileList({ files }) {
	return (
		<Container>
			{files.map((uploadedFile) => (
				<li>
					<FileInfo>
						<Preview
							src={
								uploadedFile.preview
							}
						/>
						<div>
							<strong>
								{
									uploadedFile.name
								}
							</strong>
							<span>
								{
									uploadedFile.readableSize
								}
								{
									!!uploadedFile.url && (
										<button
									onClick={() => {}}>
									Excluir
								</button>
									)
								}
							</span>
						</div>
					</FileInfo>
					<div>
						{!uploadedFile.uploaded &&
							!uploadedFile.error && (
								<CircularProgressbar
									styles={{
										root: {
											width: 24,
										},
										path: {
											stroke:
												'#7159c1',
										},
									}}
									minValue={
										0
									}
									maxValue={
										100
									}
									value={
										uploadedFile.progress
									}
									strokeWidth={
										10
									}
								/>
							)}

						{uploadedFile.url && (
							<a
								href='https://uploadteste10.s3-sa-east-1.amazonaws.com/3329bce3bfe62c4af954f426fe576046-Captura%20de%20tela%20de%202021-03-29%2021-22-38.png'
								target='_blank'>
								<MdLink
									style={{
										marginRight: 0,
									}}
									size={
										24
									}
									color='#222'
								/>
							</a>
						)}

						{uploadedFile.uploaded && (
							<MdCheckCircle
								size={24}
								color='#78e5d5'
							/>
						)}

						{uploadedFile.error && (
							<MdError
								size={24}
								color='#e57878'
							/>
						)}
					</div>
				</li>
			))}
		</Container>
	)
}

export default FileList
